import React from 'react';
import { Dimensions, KeyboardAvoidingView,
         StyleSheet, Image, View, TextInput, Text, TouchableOpacity 
} from 'react-native';
import user2 from './../../assets/user2.jpeg';

const width = Dimensions.get('screen').width;

export default function Login(){
    return(
        <KeyboardAvoidingView>
            <View style={css.container}>
                <View style={css.topo1}></View>
                <Image style={css.img1} source={user2}/>
            </View>
            <TextInput
                placeholder="Nome "
                style={css.input}
            />
            <TextInput
                placeholder={'CPF'}
                keyboardType="numeric"
                style={css.input}
            />
            <TextInput
                placeholder={'00 0 0000-0000'}
                keyboardType="numeric"
                style={style.input}
            />
            <TextInput
                placeholder={'00 0 0000-0000'}
                keyboardType="Telefone"
                style={css.input}
            />
            <TouchableOpacity onPress={() => Alert.alert('oi')} style={style.btn}>
                <Text style={css.btnText}>
                    Cadastrar
                </Text>
            </TouchableOpacity>
        </KeyboardAvoidingView>
    )
}
const css = StyleSheet.create({
    container: {
        display: "flex",
        alignContent: "center",
        alignItems: "center",
    },
    topo1: {
        width: "100%",
        height: 50,
        backgroundColor: "red",
        marginBottom: 50
    },
    img1: {
        width: 200,
        height: 200,
        borderRadius: 100,
        marginBottom: 50
    }
})
